import React, { Component } from 'react'
import axios from 'axios'

class GameRoom extends Component {
  constructor(props){
    super(props)
    this.state = {
      room : ''
    }
  }
  render () {
    return (
      <div>
        <h3>Room {this.props.room.id}</h3>
        <p>Player 1: {this.props.user.email}</p>
        <button><a href={`#/session/${this.props.id}`}>Join</a></button>
      </div>
    )
  }
}

export default GameRoom
